import React from "react";
import "./style.css"


const MakeCall = () => {

    console.log()

    const JsSIP = require('jssip')
    const GLOBAL = require('../globals')

    function register(user, pass, cb) {
        console.log('Registering to SIP')
        JsSIP.debug.disable('JsSIP:*')
        const address = GLOBAL.jssip_server + ':' + GLOBAL.jssip_port
        let socket = new JsSIP.WebSocketInterface('ws://' + address + '/ws')

        const configuration = {
            sockets: [socket],
            uri: 'sip:' + user + '@' + GLOBAL.jssip_server,
            authorization_user: user,
            password: pass,
            connection_recovery_min_interval: 3,
            register: true
        }
        let ua = new JsSIP.UA(configuration)
        ua.start()
        cb(ua)
    }
    const makeCall = () => {
        // console.log("coolPhone",coolPhone)
    };
    return (

        <React.Fragment>
            <div id="divCalling" className="demo-block">
                <button type="text" onClick={makeCall}>register</button>
                <div id="dialpad">
                    <table>
                        <tbody>
                        <tr>
                            <td><input type="button" value="1"/></td>
                            <td><input type="button" value="2"/></td>
                            <td><input type="button" value="3"/></td>
                        </tr>
                        <tr>
                            <td><input type="button" value="4"/></td>
                            <td><input type="button" value="5"/></td>
                            <td><input type="button" value="6"/></td>
                        </tr>
                        <tr>
                            <td><input type="button" value="7"/></td>
                            <td><input type="button" value="8"/></td>
                            <td><input type="button" value="9"/></td>
                        </tr>
                        <tr>
                            <td><input type="button" value="*"/></td>
                            <td><input type="button" value="0"/></td>
                            <td><input type="button" value="#"/></td>
                        </tr>
                        </tbody>
                    </table>
                </div>


            </div>
        </React.Fragment>
    )
};

export default MakeCall;
